  // }
  render(){
    return (
      <BrowserRouter>
        <div>
          <Header/>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/product" component={Product} addToCart={this.addToCart}>

            </Route>
            <Route path="/cart" component={Cart} />
            <Route path="/about" component={About} />
          </Switch>
          <Footer/>
        </div>
      </BrowserRouter>
    );
  }
}export default App
